import React from "react";
import { Home, Posts } from "./components";
import { Route, Switch, Link } from "react-router-dom";

const App = () => {
  return (
    <div>
      <nav>
        <Link to="/">Home</Link>
      </nav>
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/Posts">
          <Posts />
        </Route>
      </Switch>
    </div>
  );
};

export default App;
